import styled from 'styled-components';

export const Container= styled.div`
 
    button{
      position: relative;
      width: 150px;
      border-style: none;
      background-color: #f6f8fc;
      border-radius: 9px;
      left: 14%;
    bottom: 75px;
    box-shadow: 3px 6px 15px rgba(13, 13, 14, 0.774);
    }
`;
